DROP TABLE IF EXISTS `mc_order`;
CREATE TABLE `mc_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `member_id` bigint(20) NOT NULL DEFAULT '0',
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `expired_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '订单失效时间',
  `is_expired` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否失效',
  `sn` varchar(100) NOT NULL DEFAULT '' COMMENT '订单编号',
  `amount_paid` decimal(21,2) DEFAULT NULL COMMENT '支付金额',
  `fee` decimal(21,2) DEFAULT NULL COMMENT '手续费',
  `tax` decimal(21,2) DEFAULT NULL COMMENT '税费',
  `freight` decimal(21,2) DEFAULT NULL COMMENT '运费',
  `offset_amount` decimal(21,5) DEFAULT NULL COMMENT '优惠',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '收货地址',
  `zip_code` varchar(255) DEFAULT NULL COMMENT '邮编',
  `area` bigint(20) DEFAULT NULL,
  `area_name` varchar(255) NOT NULL,
  `consignee` varchar(255) NOT NULL DEFAULT '' COMMENT '收件人',
  `phone` varchar(255) NOT NULL DEFAULT '' COMMENT '收件人手机号',
  `is_invoice` bit(1) DEFAULT NULL COMMENT '是否要发票',
  `invoice_title` varchar(255) DEFAULT NULL COMMENT '发票抬头',
  `invoice_type` varchar(255) DEFAULT NULL COMMENT '发票类型',
  `order_status` int(11) NOT NULL,
  `point` bigint(20) NOT NULL DEFAULT '0' COMMENT '积分',
  `payment_status` int(11) NOT NULL DEFAULT '0' COMMENT '支付状态，0：未支付，1：已支付',
  `payment_method_name` varchar(255) NOT NULL DEFAULT '',
  `payment_plugin_id` varchar(255) NOT NULL DEFAULT '',
  `is_promotion` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否参与促销',
  `promotion_id` int(11) NOT NULL DEFAULT '0' COMMENT '促销活动id',
  `promotion_name` varchar(255) DEFAULT NULL COMMENT '促销',
  `promotion_discount` decimal(21,6) NOT NULL,
  `is_coupon` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否使用优惠券',
  `coupon_code` bigint(20) DEFAULT NULL COMMENT '优惠券',
  `coupon_discount` decimal(21,2) DEFAULT NULL COMMENT '代金券金额',
  `payment_method` bigint(20) DEFAULT NULL,
  `deliver_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '发货状态，0：未发货，1：正在发货，2：已签收',
  `shipping_status` int(11) NOT NULL DEFAULT '0',
  `shipping_method` bigint(20) DEFAULT NULL,
  `shipping_method_name` varchar(255) NOT NULL DEFAULT '',
  `confirm_delivery_time` datetime DEFAULT NULL COMMENT '确认收货时间',
  `refund_status` tinyint(3) DEFAULT '0' COMMENT '退款状态，0：未退款，1：正在退款，2：退款成功',
  `agree_return` int(11) DEFAULT NULL,
  `memo` varchar(255) DEFAULT NULL COMMENT '备注',
  `memo_flag` int(11) DEFAULT NULL,
  `seller_memo` varchar(255) DEFAULT NULL,
  `is_allocated_stock` bit(1) DEFAULT NULL COMMENT '是否商铺派送',
  `bank_code` varchar(255) DEFAULT NULL,
  `bank_name` varchar(255) DEFAULT NULL,
  `order_source` varchar(255) DEFAULT NULL,
  `operator` bigint(20) DEFAULT NULL,
  `system_type` varchar(255) DEFAULT NULL,
  `system_version` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5421 DEFAULT CHARSET=utf8;

